import React from "react";
import "./Navbar.css";
const Navbar = () => {
  return (
    <nav className="navbar-container">
      <div className="logo">
        <h1>TR</h1>
      </div>
      <ul className="nav-links-container">
        <li className="nav-links">
          <a href=""> HOME </a>
        </li>
        <li className="nav-links">
          <a href=""> WORK </a>
        </li>
        <li className="nav-links">
          <a href=""> ABOUT </a>
        </li>
        <li className="nav-links">
          <a href=""> CONTACT </a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
